import {
	BrowserRouter,
	Routes,
	Route
} from "react-router-dom";
import Landing from "./pages/Landing";
import GalleryReact from "./components/tabProduct/GalleryReact";
import Navbar from "./components/navbar/Navbar"
import Footer from "./components/footer/Footer"
import Home from "./pages/Home"


function App() {
	return ( <
		div className = "App" >
		<
		BrowserRouter >
		<
		Navbar / >
		<
		Routes >
		<
		Route path = "/"
		element = {
			< Landing / >
		}
		/> <
		Route path = "/gallery"
		element = {
			< GalleryReact / >
		} >
		<
		Route path = ":category"
		element = {
			< GalleryReact / >
		}
		/> <
		/Route>	 <
		Route path = "/shopping"
		element = {
			< Home / >
		}
		/>			 <
		/Routes> <
		Footer / >
		<
		/BrowserRouter> 


		<
		/div>
	);
}

export default App;
